import React from 'react';
import { PropTypes as T } from 'prop-types';
import classnames from 'classnames';

import Rating from '../Rating/Rating';
import styles from './styles.module.css';

import { Link } from 'react';

export class Item extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      hovered: false,
      placeName: this.props.place.planeName,
      address: this.props.place.address,
      lat: this.props.place.lat,
      lng: this.props.place.lng,
      type: this.props.place.type,
      comments: this.props.place.comments
    }
  }

  onClick(e) {
    this.props.onClick(this.props.place);
    return
  }


  render() {
    const {place} = this.props;
    return (
      <div
        onClick={this.onClick.bind(this)}
        className={classnames(styles.item, {
        [styles.itemHovered]: this.state.hovered
      })}>

        <h1 className={classnames(styles)}>{place.placeName}</h1>
        <Rating className={styles.rating}
                percentage={(place.rating/5)} />
      </div>
    )
  }
}

Item.propTypes = {
  place: T.object.isRequired,
  onHighlight: T.func,
}

Item.defaultProps = {
  onHighlight: () => {},
  offHighlight: () => {}
}

export default Item
